from typing import List


class Solution:
    def maximumScore(self, nums: List[int], multipliers: List[int]) -> int:
        import functools
        n = len(nums)
        m = len(multipliers)

        @functools.lru_cache(maxsize=None)
        def dfs(i, j, k):
            if k == m:
                return 0
            r1 = multipliers[k] * nums[i] + dfs(i + 1, j, k + 1)
            r2 = multipliers[k] * nums[j] + dfs(i, j - 1, k + 1)
            return max(r1, r2)

        res = dfs(0, n - 1, 0)
        dfs.cache_clear()
        return res


